      SELECT DISTINCT - col1 + col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 BETWEEN col0 + 17 / - CAST ( NULL AS REAL ) AND col0;
  - name: tab1

outputs:
  - name: q12046.out
    data: |
      82
